","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CMYBEM2rARgBIhMI49aW9rTthwMV_wweAB1vXQ6L","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Welcome to your 15 Minutes Full Body Stretching Routine! This short and well balanced sequence provides you with everything you need to get your daily dose of flexibility, mobility \u0026 relaxation. Feel free to implement this routine in your daily workout schedule to get the best results. Physically and mentally.\n\nI´m also really happy that you enjoy my playlist for this routine.\nThese are the songs I used:\n\nMichael FK - Change\nL.M. Styles - Wait on you\nFaith Richards - My Caffeine\nSarah Angel - Lakeview\nMuted - Belonging (it’s the piano piece)\n\n___\n\nWillkommen zur 15 Minuten Full Body Stretch Einheit! Zu einem ausgewognen Training, gehört auch ausreichend Erholung und Recovery! Daher steht an Tag 7 unserer Fitness-Journey eine wohltuende und ausgleichende Stretching-Routine auf dem Plan. Für mehr Flexibilität, Erholung \u0026 Entspannung.\n\nJa, auch dieses Video kommt ohne Voice-Over ;) Bewusst! Denn entgegen einer geführten Stretching- oder Yoga-Einheit ist man hier wirklich mal ganz bei sich! Nur du, die Musik, dein Atem und ein kleiner Beep hier und da ;) Vielleicht öffnest du dich also heute mal ganz unvoreingenommen für genau diesen Weg. Auch wenn es nur ein einziges Mal ist.\nEs wird anders anders sein - davon bin ich überzeugt. Denn wenn es im Aussen still ist, wird es Innen oftmals ganz schön laut.\n\nIch möchte dich ermutigen, dich einzulassen…\nDie Positionen zu genießen und zu erforschen…\nGedanken, die währenddessen aufkommen, einfach zu beobachten…Gut sein zu lassen…Anzunehmen…\nLoszulassen…\nZu sein!\n\nDarüberhinaus ist diese Art des Praktizierens ein gute Möglichkeit für einen Übergang zu einer Yoga Self Practise - also das eigenständige Praktizieren.Die Asanas und die Zeit sind vorgegeben, aber die Instruktionen sind dieses Mal dir selbst überlassen.Falls du also schon ein Weilchen mit mir Yoga praktizierst, nutze die heutige „no-talking-session“ doch gerne für eine kleine Bestandsaufnahme in Sachen Ausrichtung und Mindset. \nWas machen die Schultern in der Vorbeuge, wo sind die Hände im Vierfüßler ausgerichtet und wie hieß nochmal der herabschauenden Hund auf Sanskrit… ;)\n\nDas ist nur eine kleiner Impuls meinerseits, denn in meinen Augen bieten uns unterschiedliche Situation nunmal unterschiedlichste Möglichkeiten. Wir müssen nur genau hinschauen und sie wahrnehmen… und annehmen!\n\nWenn du nicht dennoch sträubst, auch in Ordnung ❤️.\nDann mache stattdessen gerne diese geführte Full Body Stretch Einheit (15 Minuten):    • Yoga Ganzkörper Stretching Routine | ...  \nWenn du mehr willst, mache 30 Minuten Full Body Stretch:    • Yoga Deep Stretch Routine | Den ganze...  \n\n\nUnd wenn du dich fragst, was erzählt sie da eigentlich, ich will mich doch einfach nur Dehnen 😂😂😂\nPerfekt! Dann bist du genau richtig hier ❤️\n\nSchön, dass du da bist.\nAlles Liebe.\nMady 🤘🏼🐾\n\n\n\n********************************\n\n\nNO ADS!\nWie in allen meinen Einheiten, schalte ich innerhalb der Videos keine Werbung! Ihr werdet also nicht mitten im Workout unterbrochen.\n\n\n\nDiese Yoga-Einheit könnt ihr ganz prima im Anschluss absolvieren:\n   • Yoga Ganzkörper Flow | Bauch, Beine \u0026...  \n\n\nMeine Yogamatte: \nhttp://amzn.to/2mo8NNr *\n\n\n\n********************************\n\n\n\n7  DAYS - 7 WORKOUTS\n\nRepeat this Workout Schedule for at least 4 Weeks to get the best results!\n\nDay 1 // Full Body Workout:    • Full Body Workout für Beginner | No E...  \nDay 2 // Legs \u0026 Booty Workout:    • Toned Legs, Thighs \u0026 Booty | Best Hom...  \nDay 3 // Intensive ABS Workout:    • 10 Minute Abs Home Workout  | This is...  \nDay 4 // Fat Burning HIIT:    • Fat Burning HIIT Workout | No equipme...  \nDay 5 // Booty Burn:    • 15 Min. Booty Burn | Best Home Workou...  \nDay 6 // Arms, Abs \u0026 Back:    • Toned Arms, Abs \u0026 Back Workout | No e...  \nDay 7 // Deep Stretch:    • 15 Min. Full Body Stretch | Daily Rou...  \n\nI am also working on printable workout guides, to keep you motivated and track your sessions!\n\n********************************\n\n\n\nEQUIPMENT:\n\nMeine liebste Matte: \nhttp://amzn.to/2mo8NNr *\n\nMeine Vlogging Cam: \nhttp://amzn.to/1GsIWWo *\n\nMein Make Up 100% Bio- bzw Naturkosmetik\nhttp://amzn.to/1LtYY89 *\n\nMein neuer Mixer (macht die besten Smoothies ever!)\nhttp://amzn.to/2n4BayW *\n\n\n\n\n\n********************************\n\n\nMUSIK: www.epidemicsound.com\n\n\n********************************\n\n\n\n\nFür tägliche Inspiration YOGA, TRAVEL \u0026 FOOD :\n\nInstagram :   / madymorrison  \nFacebook:   / morrison.mady  \nBlog: http://www.madymorrison.com","commandRuns":[{"startIndex":2458,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CMYBEM2rARgBIhMI49aW9rTthwMV_wweAB1vXQ6L","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=qFgwrTc1e1I\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"qFgwrTc1e1I","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=a85830ad37357b52\u0026ip=177.67.157.112\u0026initcwndbps=1052500\u0026mt=1723395179\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTIxOTc3MQ\u0026rxtags=Cg4KAnR4Egg1MTE5MTQ2MA%2CCg4KAnR4Egg1MTE5MTQ2MQ%2CCg4KAnR4Egg1MTE5MTQ2Mg%2CCg4KAnR4Egg1MTIxOTc3MQ"}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: Yoga Ganzkörper Stretching Routine | ..."}}},{"sta dymorrison"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/ytc/AIdro_myyDZtX1Ueod8MSB3WcWMNOF1Kv9v7c9W6wgY6M7PN6AQ=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"simpleText":"Show more"},"showLessText":{"simpleText":"Show less"},"attributedDescriptionBodyText":{"content":"Welcome to your 15 Minutes Full Body Stretching Routine! This short and well balanced sequence provides you with everything you need to get your daily dose of flexibility, mobility \u0026 relaxation. Feel free to implement this routine in your daily workout schedule to get the best results. Physically and mentally.\n\nI´m also really happy that you enjoy my playlist for this routine.\nThese are the songs I used:\n\nMichael FK - Change\nL.M. Styles - Wait on you\nFaith Richards - My Caffeine\nSarah Angel - Lakeview\nMuted - Belonging (it’s the piano piece)\n\n___\n\nWillkommen zur 15 Minuten Full Body Stretch Einheit! Zu einem ausgewognen Training, gehört auch ausreichend Erholung und Recovery! Daher steht an Tag 7 unserer Fitness-Journey eine wohltuende und ausgleichende Stretching-Routine auf dem Plan. Für mehr Flexibilität, Erholung \u0026 Entspannung.\n\nJa, auch dieses Video kommt ohne Voice-Over ;) Bewusst! Denn entgegen einer geführten Stretching- oder Yoga-Einheit ist man hier wirklich mal ganz bei sich! Nur du, die Musik, dein Atem und ein kleiner Beep hier und da ;) Vielleicht öffnest du dich also heute mal ganz unvoreingenommen für genau diesen Weg. Auch wenn es nur ein einziges Mal ist.\nEs wird anders anders sein - davon bin ich überzeugt. Denn wenn es im Aussen still ist, wird es Innen oftmals ganz schön laut.\n\nIch möchte dich ermutigen, dich einzulassen…\nDie Positionen zu genießen und zu erforschen…\nGedanken, die währenddessen aufkommen, einfach zu beobachten…Gut sein zu lassen…Anzunehmen…\nLoszulassen…\nZu sein!\n\nDarüberhinaus ist diese Art des Praktizierens ein gute Möglichkeit für einen Übergang zu einer Yoga Self Practise - also das eigenständige Praktizieren.Die Asanas und die Zeit sind vorgegeben, aber die Instruktionen sind dieses Mal dir selbst überlassen.Falls du also schon ein Weilchen mit mir Yoga praktizierst, nutze die heutige „no-talking-session“ doch gerne für eine kleine Bestandsaufnahme in Sachen Ausrichtung und Mindset. \nWas machen die Schultern in der Vorbeuge, wo sind die Hände im Vierfüßler ausgerichtet und wie hieß nochmal der herabschauenden Hund auf Sanskrit… ;)\n\nDas ist nur eine kleiner Impuls meinerseits, denn in meinen Augen bieten uns unterschiedliche Situation nunmal unterschiedlichste Möglichkeiten. Wir müssen nur genau hinschauen und sie wahrnehmen… und annehmen!\n\nWenn du nicht dennoch sträubst, auch in Ordnung ❤️.\nDann mache stattdessen gerne diese geführte Full Body Stretch Einheit (15 Minuten):    • Yoga Ganzkörper Stretching Routine | ...  \nWenn du mehr willst, mache 30 Minuten Full Body Stretch:    • Yoga Deep Stretch Routine | Den ganze...  \n\n\nUnd wenn du dich fragst, was erzählt sie da eigentlich, ich will mich doch einfach nur Dehnen 😂😂😂\nPerfekt! Dann bist du genau richtig hier ❤️\n\nSchön, dass du da bist.\nAlles Liebe.\nMady 🤘🏼🐾\n\n\n\n********************************\n\n\nNO ADS!\nWie in allen meinen Einheiten, schalte ich innerhalb der Videos keine Werbung! Ihr werdet also nicht mitten im Workout unterbrochen.\n\n\n\nDiese Yoga-Einheit könnt ihr ganz prima im Anschluss absolvieren:\n   • Yoga Ganzkörper Flow | Bauch, Beine \u0026...  \n\n\nMeine Yogamatte: \nhttp://amzn.to/2mo8NNr *\n\n\n\n********************************\n\n\n\n7  DAYS - 7 WORKOUTS\n\nRepeat this Workout Schedule for at least 4 Weeks to get the best results!\n\nDay 1 // Full Body Workout:    • Full Body Workout für Beginner | No E...  \nDay 2 // Legs \u0026 Booty Workout:    • Toned Legs, Thighs \u0026 Booty | Best Hom...  \nDay 3 // Intensive ABS Workout:    • 10 Minute Abs Home Workout  | This is...  \nDay 4 // Fat Burning HIIT:    • Fat Burning HIIT Workout | No equipme...  \nDay 5 // Booty Burn:    • 15 Min. Booty Burn | Best Home Workou...  \nDay 6 // Arms, Abs \u0026 Back:    • Toned Arms, Abs \u0026 Back Workout | No e...  \nDay 7 // Deep Stretch:    • 15 Min. Full Body Stretch | Daily Rou...  \n\nI am also working on printable workout guides, to keep you motivated and track your sessions!\n\n********************************\n\n\n\nEQUIPMENT:\n\nMeine liebste Matte: \nhttp://amzn.to/2mo8NNr *\n\nMeine Vlogging Cam: \nhttp://amzn.to/1GsIWWo *\n\nMein Make Up 100% Bio- bzw Naturkosmetik\nhttp://amzn.to/1LtYY89 *\n\nMein neuer Mixer (macht die besten Smoothies ever!)\nhttp://amzn.to/2n4BayW *\n\n\n\n\n\n********************************\n\n\nMUSIK: www.epidemicsound.com\n\n\n********************************\n\n\n\n\nFür tägliche Inspiration YOGA, TRAVEL \u0026 FOOD :\n\nInstagram :   / madymorrison  \nFacebook:   / morrison.mady  \nBlog: http://www.madymorrison.com","commandRuns":[{"startIndex":2458,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBsQ040EGAQiEwjj1pb2tO2HAxX_DB4AHW9dDos=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=qFgwrTc1e1I\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"qFgwrTc1e1I","startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-5h25gvcg-8j2e.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odepv=1\u0026id=a85830ad37357b52\u0026ip=177.67.157.112\u0026initcwndbps=1052500\u0026mt=1723395179\u0026oweuc=\u0026pxtags=Cg4KAnR4Egg1MTIxOTc3MQ\u0026rxtags=Cg4KAnR4Egg1MTE5MTQ2MA%2CCg4KAnR4Egg1MTE5MTQ2MQ%2CCg4KAnR4Egg1MTE5MTQ2Mg%2CCg4KAnR4Egg1MTIxOTc3MQ"}}}}}},"onTapOptions":{"accessibilityInfo":{"accessibilityLabel":"YouTube Channel Link: Yoga Ganzkörper Stretching Routine | ..."}}},{"startIndex":2563,"length":
